gseq____&quot;,379,536870952]],[logseq____&quot;^15logseq____&quot;,[1326,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u670d870d-73b7-4e4f-b985-58cb66851d65logseq____&quot;,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Flogseq____&quot;,1326,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Xlogseq____&quot;,379,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Vlogseq____&quot;,379,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Ulogseq____&quot;,379,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Ulogseq____&quot;,1324,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^Hlogseq____&quot;,1324,536870952]],[logseq____&quot;^15logseq____&quot;,[1327,logseq____&quot;^;logseq____&quot;,logseq____&q
